python3 << 'EOF'
import json
import base64

har_path = "/Users/imorgado/LOOKSMAXX/beta.faceiqlabs.com.har"

with open(har_path, 'r') as f:
    har = json.load(f)

# Extract POST /api/side-landmarks request
print("=" * 80)
print("POST /api/side-landmarks")
print("=" * 80)

for entry in har['log']['entries']:
    request = entry['request']
    response = entry.get('response', {})

    if '/api/side-landmarks' in request['url'] and request['method'] == 'POST':
        post_data = request.get('postData')
        if post_data:
            mime = post_data.get('mimeType', '')
            print(f"\nRequest MIME Type: {mime}")

            if 'multipart/form-data' in mime:
                print("Content: multipart/form-data with 'image' field (JPEG binary)")
                print("  - Field name: 'image'")
                print(f"  - Field type: image/jpeg (binary)")

        # Check response
        if response.get('content'):
            content = response['content']
            print(f"\nResponse Content Type: {content.get('mimeType')}")

            try:
                text = content.get('text', '')
                if content.get('encoding') == 'base64':
                    text = base64.b64decode(text).decode('utf-8')

                data = json.loads(text[:3000])
                print(f"Response Keys: {list(data.keys())}")

                # Print structure
                for k, v in data.items():
                    if isinstance(v, dict):
                        print(f"  - {k}: {type(v).__name__} with keys {list(v.keys())[:10]}")
                        if k == 'landmarks':
                            landmark_names = list(v.keys())
                            print(f"    Landmark names: {landmark_names}")
                    elif isinstance(v, list):
                        print(f"  - {k}: list with {len(v)} items")
                    else:
                        print(f"  - {k}: {str(v)[:100]}")
            except Exception as e:
                print(f"Response parse error: {e}")

        break

# Now get auth/session and subscription data
print("\n" + "=" * 80)
print("GET /api/auth/session")
print("=" * 80)

for entry in har['log']['entries']:
    request = entry['request']
    response = entry.get('response', {})

    if '/api/auth/session' in request['url'] and request['method'] == 'GET':
        print(f"\nRequest: No body (GET request)")

        # Check response
        if response.get('content'):
            content = response['content']
            try:
                text = content.get('text', '')
                if content.get('encoding') == 'base64':
                    text = base64.b64decode(text).decode('utf-8')

                data = json.loads(text)
                print(f"Response Keys: {list(data.keys())}")

                for k, v in data.items():
                    if isinstance(v, dict):
                        print(f"  - {k}: {type(v).__name__} with keys {list(v.keys())}")
                    elif isinstance(v, list):
                        print(f"  - {k}: list")
                    elif isinstance(v, str):
                        print(f"  - {k}: '{v}'")
                    else:
                        print(f"  - {k}: {v}")
            except Exception as e:
                print(f"Response parse error: {e}")

        break

# Get subscription info
print("\n" + "=" * 80)
print("GET /api/subscription")
print("=" * 80)

for entry in har['log']['entries']:
    request = entry['request']
    response = entry.get('response', {})

    if '/api/subscription' in request['url'] and request['method'] == 'GET':
        print(f"\nRequest: No body (GET request)")

        # Check response
        if response.get('content'):
            content = response['content']
            try:
                text = content.get('text', '')
